    const returnButtonsClick = (e) => {
        console.log('ok', e.target);
    };
    
    return (
        <div className="game">
            <LeftSide />
            <Board color={1} prevButtons={returnButtonsClick}/>
            <RightSide clickButton={returnButtonsClick}/>
        </div>
    );
};
